import React, { useEffect, useState } from "react";
import {
  ScrollView,
  View,
  KeyboardAvoidingView,
  Platform,
  Text,
  Pressable,
  TextInput,
} from "react-native";
import { SvgXml } from "react-native-svg";
import Input from "../../components/Input";
import { icon, styles } from "../../screens/create_dashboard/BusinessTitle";
import DateTimePickerModal from "react-native-modal-datetime-picker";
import {
  changeTime,
  convertDate,
  serverTimeToLocal,
  serverTimeToLocalDate,
} from "../../action";
import IconButton from "../../components/IconButton";
import { CheckBox, Days } from "../Seller/Pricing";
import Animated, { FadeIn } from "react-native-reanimated";
import ViewMore from "../../Hooks/ViewMore";
import { useDispatch, useSelector } from "react-redux";
import { useIsFocused } from "@react-navigation/native";
import { setHideBottomBar } from "../../Reducers/hideBottomBar";
import {
  localTimeToServerTime,
  serverTimeToLocalTime,
} from "../../Class/dataConverter";
import { updateData } from "../../Class/update";
import { getService } from "../../Class/service";
import customStyle from "../../assets/stylesheet";
import ActivityLoader from "../../components/ActivityLoader";
import { Feather } from '@expo/vector-icons';

export default function CompanyCalendar({ navigation, route }) {
  const businessForm = useSelector((state) => state.businessForm);
  const [checked, setChecked] = useState(false);
  const [visible, setVisible] = React.useState({
    title: "",
    visible: false,
  });
  const [Times, setTimes] = React.useState([]);
  const [TimesError, setTimesError] = React.useState([]);
  const [TimeError, setTimeError] = React.useState();
  const [layoutHeight, setLayoutHeight] = useState(0);
  const data = route?.params?.data;
  const [time, setTime] = useState(0);
  const dispatch = useDispatch();
  const isFocused = useIsFocused();
  const t47 = route?.params?.t47;
  const workingTime = route?.params?.workingTime;
  const user = useSelector((state) => state.user);
  const vendor = useSelector((state) => state.vendor);
  const [loader, setLoader] = useState(false);
  const days=[
    "Saturday","Sunday","Monday","Tuesday","Wednesday","Thursday","Friday"
  ]

  React.useEffect(() => {
    if (isFocused) {
      //console.log("hidden")
      dispatch(setHideBottomBar(true));
      setTimeout(() => {
        dispatch(setHideBottomBar(true));
      }, 50);
    } else {
      //console.log("seen")
      dispatch(setHideBottomBar(false));
    }
  }, [isFocused]);
  useEffect(() => {
    
    let arr = [];
    workingTime?.map((doc) => {
      arr.push(serverTimeToLocalTime(doc));
    });
    if (t47) {
      setChecked(true);
    } else {
      setChecked(false);
    }
    setTimes(arr);
  }, [t47, workingTime]);
  const updateInfo = () => {
    setLoader(true);
    let arr = [];
    Times?.map((doc) => {
      if (doc) {
        arr.push(localTimeToServerTime(doc));
      }
    });
    updateData(user.token, {
      serviceId: vendor.service.id,
      workingTime: arr,
      t47:checked
    })
      .then((res) => {
        updateVendorInfo();
      })
      .catch((err) => {
        setLoader(false);
        console.error(err.response.data.msg);
      });
  };
  const updateVendorInfo = async () => {
    const res = await getService(user.token, vendor.service.id);
    if (res) {
      setLoader(false);
      dispatch({ type: "SET_VENDOR", playload: res.data });
      navigation.goBack();
    }
  };
  if (loader) {
    return (
      <View style={customStyle.fullBox}>
        <ActivityLoader />
      </View>
    );
  }
  return (
    <KeyboardAvoidingView
      style={{ flex: 1 }}
      behavior={Platform.OS === "ios" ? "padding" : null}
      keyboardVerticalOffset={Platform.OS === "ios" ? 80 : 0}>
      <ScrollView showsVerticalScrollIndicator={false}>
        <View
          style={{
            marginTop: 24,
            paddingHorizontal: 20,
          }}>
          <SvgXml width={"100%"} xml={vectorImage} />
          {vendor ? (
            <>
              <View
                style={{
                  flexDirection: "row",
                  flex: 1,
                  marginTop: 36,
                }}>
                <SvgXml
                  style={{
                    marginRight: 8,
                  }}
                  xml={icon}
                />
                <Text style={[styles.headLine, { flex: 1 }]}>
                  Tips for set up the working time
                </Text>
              </View>
              <ViewMore
                style={{
                  marginTop: 24,
                }}
                width={142}
                height={layoutHeight}
                component={
                  <Text
                    onLayout={(e) =>
                      setLayoutHeight(e.nativeEvent.layout.height)
                    }
                    style={[styles.spText, { marginTop: 0 }]}>
                    We require information on your working time to help
                    potential buyers understand when you're available to provide
                    your services. If you are a{" "}
                    <Text style={{ fontWeight: "700" }}>company</Text>, please
                    input your working hours as accurately as possible. If you
                    are an <Text style={{ fontWeight: "700" }}>individual</Text>
                    , please enter the days and times when you are usually
                    available to work. However, if you have a flexible schedule
                    or can work any day, please enter your preferred working
                    hours instead. This will help buyers determine whether your
                    services fit their needs.
                  </Text>
                }
              />
              <View
                style={{
                  flexDirection: "row",
                  alignItems: "center",
                  marginTop: 36,
                  justifyContent: "space-between",
                }}>
                <Text style={[styles.headLine, { marginTop: 0 }]}>
                  Select time
                </Text>
                <CheckBox
                  value={checked}
                  onChange={() => {
                    setChecked(!checked);
                  }}
                  disabled={vendor ? false : true}
                  title={"24/7 open"}
                  style={{
                    width: 110,
                    justifyContent: "flex-end",
                  }}
                />
              </View>
              <View style={{ height: 24 }} />
              {!checked ? (
                <Animated.View entering={FadeIn}>
                  <Days
                    value={Times}
                    error={TimesError[0]}
                    onChange={(val) => {
                      let arr = Times;
                      arr[0] = val;

                      setTimes(arr);
                      setTime((d) => d + 1);
                    }}
                    disabled={vendor ? false : true}
                    setVisible={setVisible}
                    title="Saturday"
                  />
                  <Days
                    value={Times}
                    error={TimesError[1]}
                    onChange={(val) => {
                      let arr = Times;
                      arr[1] = val;
                      setTimes(arr);
                      setTime((d) => d + 1);
                    }}
                    disabled={vendor ? false : true}
                    setVisible={setVisible}
                    title="Sunday"
                    style={{ marginTop: 16 }}
                  />
                  <Days
                    value={Times}
                    error={TimesError[2]}
                    onChange={(val) => {
                      let arr = Times;
                      arr[2] = val;
                      setTimes(arr);
                      setTime((d) => d + 1);
                    }}
                    disabled={vendor ? false : true}
                    setVisible={setVisible}
                    title="Monday"
                    style={{ marginTop: 16 }}
                  />
                  <Days
                    value={Times}
                    error={TimesError[3]}
                    onChange={(val) => {
                      let arr = Times;
                      arr[3] = val;
                      setTimes(arr);
                      setTime((d) => d + 1);
                    }}
                    disabled={vendor ? false : true}
                    setVisible={setVisible}
                    title="Tuesday"
                    style={{ marginTop: 16 }}
                  />
                  <Days
                    value={Times}
                    error={TimesError[4]}
                    onChange={(val) => {
                      let arr = Times;
                      arr[4] = val;
                      setTimes(arr);
                      setTime((d) => d + 1);
                    }}
                    disabled={vendor ? false : true}
                    setVisible={setVisible}
                    title="Wednesday"
                    style={{ marginTop: 16 }}
                  />
                  <Days
                    value={Times}
                    error={TimesError[5]}
                    onChange={(val) => {
                      let arr = Times;
                      arr[5] = val;
                      setTimes(arr);
                      setTime((d) => d + 1);
                    }}
                    disabled={vendor ? false : true}
                    setVisible={setVisible}
                    title="Thursday"
                    style={{ marginTop: 16 }}
                  />
                  <Days
                    value={Times}
                    error={TimesError[6]}
                    onChange={(val) => {
                      let arr = Times;
                      arr[6] = val;
                      setTimes(arr);
                      setTime((d) => d + 1);
                    }}
                    disabled={vendor ? false : true}
                    setVisible={setVisible}
                    title="Friday"
                    style={{ marginTop: 16 }}
                  />
                </Animated.View>
              ) : (
                <></>
              )}
              {TimeError && (
                <Text
                  style={{
                    fontSize: 12,
                    marginLeft: 2,
                    fontFamily: "Poppins-Light",
                    color: "red",
                    marginTop: 3,
                  }}>
                  {TimeError}
                </Text>
              )}

              <IconButton
                active={checked || time > 0 ? true : false}
                disabled={checked || time ? false : true}
                onPress={() => {
                  //console.log(Times);

                  if (!checked && Times.length == 0) {
                    setTimeError("Please select any time");
                    //scrollingTo(250);
                    return;
                  }
                  updateInfo();
                }}
                style={styles.button}
                title={"Update"}
              />
            </>
          ) : (
            <View>
              {days.map((doc,i)=>(
                <TimeCart title={doc} t47={t47} workingTime={workingTime} key={i}/>
              ))}
              <View style={{height:28}}/>
            </View>
          )}
        </View>
      </ScrollView>
    </KeyboardAvoidingView>
  );
}
const TimeCart=({t47,workingTime,title})=>{
  const time=workingTime?.filter(d=>d.day.toLowerCase().match(title.toLowerCase()))
  if(time&&time?.length==0&&!t47){
    return null
  }
  return(
    <View style={{
      flexDirection:"row",
      justifyContent:"space-between",
      marginTop:28,
      alignItems:"center"
    }}>
      <Text style={{
        fontSize:16,
        fontWeight:"400"
      }}>{title}</Text>
      <View style={{
        flexDirection:"row",
        alignItems:"center",
        justifyContent:"flex-start",
       
      }}>
      <Feather name="clock" size={20} color="black" />
        <Text style={{
          marginLeft:5,
          fontSize:12,
          fontWeight:"400"
        }}>{t47?"24/7 open":`${time&&time?.length>0?`${changeTime(time[0].open)} - ${changeTime(time[0].close)}`:"Close"}`}</Text>
      </View>
    </View>
  )
}
